from pyspark.sql.types import Row
def split_page_data_into_news(_row):
  # row_schema = _row.
  row_dict = _row.asDict()
  new_row_dict = row_dict.copy()
  news_id_list = row_dict.get("news_id", [])
  # news_id_dict = enumerate(news_id_list)
  len_news_id_list = len(news_id_list)
  for key in new_row_dict:
    if(not isinstance(new_row_dict[key], list)):
      new_row_dict[key] = [new_row_dict[key]] * len_news_id_list
    if(1 == len(new_row_dict[key])):
      new_row_dict[key] = new_row_dict[key] * len_news_id_list
    if(0 == len(new_row_dict[key]) % len_news_id_list):
      feature_size = len(new_row_dict[key]) / len_news_id_list
      new_row_dict[key] = [new_row_dict[key][int(x * feature_size) : int((x + 1) * feature_size)] for x in range(len_news_id_list)]
  result = []
  result_dict = dict()
  for i in range(len_news_id_list):
    result_dict = { key : value[i] for key, value in new_row_dict.items() }
    result_dict.update({ key : value[0] for key, value in result_dict.items() if(1 == len(value))})
    result.append(result_dict)
  return result

